syntax = "proto3";

option java_package = "org.etri.ado.message";
option optimize_for = SPEED;

import "google/protobuf/any.proto";
import "google/protobuf/wrappers.proto";

package org.etri.ado.message;

message Unit {
	google.protobuf.Any element0 = 1;
}

message Pair {
	google.protobuf.Any element0 = 1;
	google.protobuf.Any element1 = 2;
}




